import React, { Component } from "react";
import Header from "./header";

class Main extends Component {
  state = {
    activePanel: "domestic",
  };

  renderPanel(){
    switch (this.state.activePanel) {
      case ("domestic"):
        return <DomesticPanel/>

    }
  }
  render() {
    return 
      <Header activePanel={this.state.activePanel} />;
      <BirdPanel/>;
      <DomesticPanel/>;
      <WildPanel/>;

  }
}

export default Main;
